import React, { Component } from 'react'

export class Navbar extends Component {
    render() {
        return (
            <div className="bg-blue-500 text-white flex items-center">
               <div className="logo">
                   Logo
               </div>
             <div>

                 <p>workspace</p>
                 <p>recent</p>
                 <p>more</p>
             </div>
            </div>
        )
    }
}

export default Navbar
